/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmIconLibrary 
} from '@vime/core';

import { define } from '../lib';


define('vm-icon-library', VmIconLibrary);


export interface IconLibraryProps extends JSX.VmIconLibrary, HTMLAttributes<HTMLVmIconLibraryElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmIconLibraryElement, IconLibraryProps>(
  'vm-icon-library',
  new Set(['name','resolver','icons']),
);
